import React from 'react'

function Babyplanner({login, users}) {
  const people = [
    { name: "Sarah", age: "22", gender: "Female" },
    { name: "Mike", age: "30", gender: "Male" },
    { name: "Anna", age: "20", gender: "Female" },
    { name: "Sarah", age: "22", gender: "Female" },
    { name: "Mike", age: "30", gender: "Male" },
    { name: "Anna", age: "20", gender: "Female" },
  ];
  const [data, setData] = useState(people)
  const femaleFilter = () =>{
    let peopleGender = people.filter(i => i.gender === 'Female')
    setData(peopleGender)
  }
 
  const maleFilter = () =>{
    let peopleGender = people.filter(i => i.gender === 'Male')
    setData(peopleGender)
  }
  
  return (
    <div className="card w-96 bg-primary text-primary-content">
      
  <div className="card-body">
    <h2 className="card-title">Enter</h2>
    <p>This is the test data page</p>
    <form onSubmit={login}>
        <input type='text' name='username'
        placeholder='type here'
        className='input input-bordered w-full max-w-xs'/>
        <select className="select select-info w-full max-w-xs">
  <option disabled selected>Select baby's gender you wish</option>
  <option>Girl</option>
  <option>Boy</option>
</select>
        <input name="gender" 
        type='gender'
        placeholder='Enter your age'
        className='input input-bordered w-full max-w-xs'/>
      <button className="btn">Enter</button> 
      </form>
    <div className="card-actions justify-end">
    </div>
  </div>
  
</div>
  )
}

export default Babyplanner

